import { RouterProvider, createBrowserRouter } from 'react-router-dom';
import EventsPage, { loader as eventLoader } from './pages/EventsPage';
import NewEventsPage from './pages/NewEventsPage.js';
import EditEventPage from './pages/EditEventPage.js';
import EventsDetailsPage, { loader as eventDetailsLoader } from './pages/EventsDetailsPage.js';
import RootLayout from './pages/Root.js';
import Home from './pages/HomePage.js';
import EventsRootLayout from './pages/EventsRoot.js';
import ErrorPage from './pages/Error.js';

const router = createBrowserRouter([
  {
    path: "/",
    element: <RootLayout />,
    errorElement: <ErrorPage />,
    children: [
      {
        index: true, element: <Home />
      },

      {
        path: "events",
        element: <EventsRootLayout />,
        children: [
          {
            index: true,
            element: <EventsPage />,
            loader: eventLoader,
          },
          {
            path: ":id",
            id: "event-details",

            children: [
              {
                index: true,
                element: <EventsDetailsPage />,
                loader: eventDetailsLoader,
              },
              {
                path: "edit",
                element: <EditEventPage />,
              },
            ]
          },
          {
            path: "new",
            element: <NewEventsPage />
          },

        ]
      },
    ],
  }
])

function App() {
  return <RouterProvider router={router} />;
}

export default App;
